import React from "react";
import "./component-styles/card.css";
import FlightTicket from "./FlightTicket";
import { tickets } from "../scripts/data";

let testArr = [
  <li>
    <FlightTicket />
  </li>,
  <li>
    <FlightTicket />
  </li>,
  <li>
    <FlightTicket />
  </li>,
];

const TicketList = () => {
  let ticketsArray = [];

  tickets().then((data) => {
    data.sort((a, b) => {
      return a.price - b.price;
    });

    for (let i = 0; i < 5; i++) {
      ticketsArray.push(
        <li>
          <FlightTicket ticket={data[i]} />
        </li>
      );
    }
  });

  console.log(ticketsArray``);

  return (
    <div className="Tickets">
      <ul>{testArr}</ul>
    </div>
  );
};

export default TicketList;
